import Expansor from "../expansor";
import Pastas from "../pastas";

function Outros() {
  return (
    <div className="outros">
      <Expansor titulo="Recursos Internos e Botões">
        <button className="conteudo-expansor">• Empresa</button>
        <button className="conteudo-expansor">• Filiais</button>
      </Expansor>

      <Expansor titulo="Fluxos e Processos"></Expansor>

      <Expansor titulo="Erros retornados da API"></Expansor>

      <Expansor titulo="Filtros Avançados (Grid Param)"></Expansor>

      <Expansor titulo="Métodos da API"></Expansor>
    </div>
  );
}

export default Outros;
